function setBodyLoaded(){document.getElementsByTagName("body")[0].classList.add("loaded")}function setAnimatedBlockLoaded(){const e=document.getElementById("animatedBlockSecond"),d=document.getElementById("animatedBlock");if(console.log(d),!d)return;let o=!1,t=!1;window.addEventListener("scroll",()=>{window.pageYOffset+window.innerHeight>d.offsetTop+300&&(t||(d.classList.add("loaded"),t=!0)),window.pageYOffset+window.innerHeight>e.offsetTop+150&&(o||(e.classList.add("loaded"),o=!0))})}window.addEventListener("load",(function(){setBodyLoaded(),setAnimatedBlockLoaded()}));